import React from 'react';

class Api extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			domain: 'localhost',
			route: this.props.route
		}
		this.fetch = this.fetch.bind(this);
	}
	fetch() {
		fetch(this.state.domain + this.state.route)
		.then(function(){console.log('ok')});
	}
	render() {
		return (
			<div>coucou</div>
		)
	}
}

export default Api;
